INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (1, 'Bulbasaur', (SELECT id FROM species WHERE name = 'Seed Pokémon'), 7, 69, 64, 'A strange seed was planted on its back at birth. The plant sprouts and grows with this POKéMON.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (2, 'Ivysaur', (SELECT id FROM species WHERE name = 'Seed Pokémon'), 10, 130, 142, 'When the bulb on its back grows large, it appears to lose the ability to stand on its hind legs.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (3, 'Venusaur', (SELECT id FROM species WHERE name = 'Seed Pokémon'), 20, 1000, 263, 'The plant blooms when it is absorbing solar energy. It stays on the move to seek sunlight.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (4, 'Charmander', (SELECT id FROM species WHERE name = 'Lizard Pokémon'), 6, 85, 62, 'Obviously prefers hot places. When it rains, steam is said to spout from the tip of its tail.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (5, 'Charmeleon', (SELECT id FROM species WHERE name = 'Flame Pokémon'), 11, 190, 142, 'When it swings its burning tail, it elevates the temperature to unbearably high levels.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (6, 'Charizard', (SELECT id FROM species WHERE name = 'Flame Pokémon'), 17, 905, 267, 'Spits fire that is hot enough to melt boulders. Known to cause forest fires unintentionally.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (7, 'Squirtle', (SELECT id FROM species WHERE name = 'Tiny Turtle Pokémon'), 5, 90, 63, 'After birth, its back swells and hardens into a shell. Powerfully sprays foam from its mouth.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (8, 'Wartortle', (SELECT id FROM species WHERE name = 'Turtle Pokémon'), 10, 225, 142, 'Often hides in water to stalk unwary prey. For swimming fast, it moves its ears to maintain balance.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (9, 'Blastoise', (SELECT id FROM species WHERE name = 'Shellfish Pokémon'), 16, 855, 265, 'A brutal POKéMON with pressurized water jets on its shell. They are used for high speed tackles.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (10, 'Caterpie', (SELECT id FROM species WHERE name = 'Worm Pokémon'), 3, 29, 39, 'Its short feet are tipped with suction pads that enable it to tirelessly climb slopes and walls.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (11, 'Metapod', (SELECT id FROM species WHERE name = 'Cocoon Pokémon'), 7, 99, 72, 'This POKéMON is vulnerable to attack while its shell is soft, exposing its weak and tender body.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (12, 'Butterfree', (SELECT id FROM species WHERE name = 'Butterfly Pokémon'), 11, 320, 198, 'In battle, it flaps its wings at high speed to release highly toxic dust into the air.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (13, 'Weedle', (SELECT id FROM species WHERE name = 'Hairy Bug Pokémon'), 3, 32, 39, 'Often found in forests, eating leaves. It has a sharp venomous stinger on its head.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (14, 'Kakuna', (SELECT id FROM species WHERE name = 'Cocoon Pokémon'), 6, 100, 72, 'Almost incapable of moving, this POKéMON can only harden its shell to protect itself from predators.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (15, 'Beedrill', (SELECT id FROM species WHERE name = 'Poison Bee Pokémon'), 10, 295, 178, 'It has three poisonous stingers on its forelegs and its tail. They are used to jab its enemy repeatedly.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (16, 'Pidgey', (SELECT id FROM species WHERE name = 'Tiny Bird Pokémon'), 3, 18, 50, 'A common sight in forests and woods. It flaps its wings at ground level to kick up blinding sand.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (17, 'Pidgeotto', (SELECT id FROM species WHERE name = 'Bird Pokémon'), 11, 300, 122, 'Very protective of its sprawling territorial area, this POKéMON will fiercely peck at any intruder.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (18, 'Pidgeot', (SELECT id FROM species WHERE name = 'Bird Pokémon'), 15, 395, 216, 'When hunting, it skims the surface of water at high speed to pick off unwary prey such as MAGIKARP.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (19, 'Rattata', (SELECT id FROM species WHERE name = 'Mouse Pokémon'), 3, 35, 51, 'Bites anything when it attacks. Small and very quick, it is a common sight in many places.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (20, 'Raticate', (SELECT id FROM species WHERE name = 'Mouse Pokémon'), 7, 185, 145, 'It uses its whis­ kers to maintain its balance. It apparently slows down if they are cut off.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (21, 'Spearow', (SELECT id FROM species WHERE name = 'Tiny Bird Pokémon'), 3, 20, 52, 'It flaps its small wings busily to fly. Using its beak, it searches in grass for prey.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (22, 'Fearow', (SELECT id FROM species WHERE name = 'Beak Pokémon'), 12, 380, 155, 'With its huge and magnificent wings, it can keep aloft without ever having to land for rest.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (23, 'Ekans', (SELECT id FROM species WHERE name = 'Snake Pokémon'), 20, 69, 58, 'Moves silently and stealthily. Eats the eggs of birds, such as PIDGEY and SPEAROW, whole.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (24, 'Arbok', (SELECT id FROM species WHERE name = 'Cobra Pokémon'), 35, 650, 157, 'It is rumored that the ferocious warning markings on its belly differ from area to area.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (25, 'Pikachu', (SELECT id FROM species WHERE name = 'Mouse Pokémon'), 4, 60, 112, 'When several of these POKéMON gather, their electricity could build and cause lightning storms.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (26, 'Raichu', (SELECT id FROM species WHERE name = 'Mouse Pokémon'), 8, 300, 243, 'Its long tail serves as a ground to protect itself from its own high-voltage power.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (27, 'Sandshrew', (SELECT id FROM species WHERE name = 'Mouse Pokémon'), 6, 120, 60, 'Burrows deep underground in arid locations far from water. It only emerges to hunt for food.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (28, 'Sandslash', (SELECT id FROM species WHERE name = 'Mouse Pokémon'), 10, 295, 158, 'Curls up into a spiny ball when threatened. It can roll while curled up to attack or escape.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (29, 'Nidoran (F)', (SELECT id FROM species WHERE name = 'Poison Pin Pokémon'), 4, 70, 55, 'Although small, its venomous barbs render this POKéMON dangerous. The female has smaller horns.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (30, 'Nidorina', (SELECT id FROM species WHERE name = 'Poison Pin Pokémon'), 8, 200, 128, 'The female''s horn develops slowly. Prefers physical attacks such as clawing and biting.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (31, 'Nidoqueen', (SELECT id FROM species WHERE name = 'Drill Pokémon'), 13, 600, 253, 'Its hard scales provide strong protection. It uses its hefty bulk to execute powerful moves.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (32, 'Nidoran (M)', (SELECT id FROM species WHERE name = 'Poison Pin Pokémon'), 5, 90, 55, 'Stiffens its ears to sense danger. The larger its horns, the more powerful its secreted venom.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (33, 'Nidorino', (SELECT id FROM species WHERE name = 'Poison Pin Pokémon'), 9, 195, 128, 'An aggressive POKéMON that is quick to attack. The horn on its head secretes a powerful venom.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (34, 'Nidoking', (SELECT id FROM species WHERE name = 'Drill Pokémon'), 14, 620, 253, 'It uses its powerful tail in battle to smash, constrict, then break the prey''s bones.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (35, 'Clefairy', (SELECT id FROM species WHERE name = 'Fairy Pokémon'), 6, 75, 113, 'Its magical and cute appeal has many admirers. It is rare and found only in certain areas.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (36, 'Clefable', (SELECT id FROM species WHERE name = 'Fairy Pokémon'), 13, 400, 242, 'A timid fairy POKéMON that is rarely seen. It will run and hide the moment it senses people.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (37, 'Vulpix', (SELECT id FROM species WHERE name = 'Fox Pokémon'), 6, 99, 60, 'At the time of birth, it has just one tail. The tail splits from its tip as it grows older.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (38, 'Ninetales', (SELECT id FROM species WHERE name = 'Fox Pokémon'), 11, 199, 177, 'Very smart and very vengeful. Grabbing one of its many tails could result in a 1000-year curse.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (39, 'Jigglypuff', (SELECT id FROM species WHERE name = 'Balloon Pokémon'), 5, 55, 95, 'When its huge eyes light up, it sings a mysteriously soothing melody that lulls its enemies to sleep.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (40, 'Wigglytuff', (SELECT id FROM species WHERE name = 'Balloon Pokémon'), 10, 120, 218, 'The body is soft and rubbery. When angered, it will suck in air and inflate itself to an enormous size.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (41, 'Zubat', (SELECT id FROM species WHERE name = 'Bat Pokémon'), 8, 75, 49, 'Forms colonies in perpetually dark places. Uses ultrasonic waves to identify and approach targets.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (42, 'Golbat', (SELECT id FROM species WHERE name = 'Bat Pokémon'), 16, 550, 159, 'Once it strikes, it will not stop draining energy from the victim even if it gets too heavy to fly.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (43, 'Oddish', (SELECT id FROM species WHERE name = 'Weed Pokémon'), 5, 54, 64, 'During the day, it keeps its face buried in the ground. At night, it wanders around sowing its seeds.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (44, 'Gloom', (SELECT id FROM species WHERE name = 'Weed Pokémon'), 8, 86, 138, 'The fluid that oozes from its mouth isn''t drool. It is a nectar that is used to attract prey.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (45, 'Vileplume', (SELECT id FROM species WHERE name = 'Flower Pokémon'), 12, 186, 245, 'It has the world’s largest petals. With every step, the petals shake out heavy clouds of toxic pollen.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (46, 'Paras', (SELECT id FROM species WHERE name = 'Mushroom Pokémon'), 3, 54, 57, 'Burrows to suck tree roots. The mushrooms on its back grow by draw­ ing nutrients from the bug host.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (47, 'Parasect', (SELECT id FROM species WHERE name = 'Mushroom Pokémon'), 10, 295, 142, 'A host-parasite pair in which the parasite mushroom has taken over the host bug. Prefers damp places.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (48, 'Venonat', (SELECT id FROM species WHERE name = 'Insect Pokémon'), 10, 300, 61, 'Lives in the shadows of tall trees where it eats insects. It is attracted by light at night.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (49, 'Venomoth', (SELECT id FROM species WHERE name = 'Poison Moth Pokémon'), 15, 125, 158, 'The dustlike scales covering its wings are color-coded to indicate the kinds of poison it has.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (50, 'Diglett', (SELECT id FROM species WHERE name = 'Mole Pokémon'), 2, 8, 53, 'Lives about one yard underground where it feeds on plant roots. It sometimes appears above ground.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (51, 'Dugtrio', (SELECT id FROM species WHERE name = 'Mole Pokémon'), 7, 333, 149, 'A team of DIGLETT triplets. It triggers huge earthquakes by burrowing 60 miles underground.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (52, 'Meowth', (SELECT id FROM species WHERE name = 'Scratch Cat Pokémon'), 4, 42, 58, 'It washes its face regularly to keep the coin on its forehead spotless. It doesn’t get along with Galarian Meowth.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (53, 'Persian', (SELECT id FROM species WHERE name = 'Classy Cat Pokémon'), 10, 320, 154, 'Although its fur has many admirers, it is tough to raise as a pet because of its fickle meanness.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (54, 'Psyduck', (SELECT id FROM species WHERE name = 'Duck Pokémon'), 8, 196, 64, 'While lulling its enemies with its vacant look, this wily POKéMON will use psychokinetic powers.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (55, 'Golduck', (SELECT id FROM species WHERE name = 'Duck Pokémon'), 17, 766, 175, 'Often seen swim­ ming elegantly by lake shores. It is often mistaken for the Japanese monster, Kappa.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (56, 'Mankey', (SELECT id FROM species WHERE name = 'Pig Monkey Pokémon'), 5, 280, 61, 'Extremely quick to anger. It could be docile one moment then thrashing away the next instant.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (57, 'Primeape', (SELECT id FROM species WHERE name = 'Pig Monkey Pokémon'), 10, 320, 159, 'Always furious and tenacious to boot. It will not abandon chasing its quarry until it is caught.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (58, 'Growlithe', (SELECT id FROM species WHERE name = 'Puppy Pokémon'), 7, 190, 70, 'Very protective of its territory. It will bark and bite to repel intruders from its space.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (59, 'Arcanine', (SELECT id FROM species WHERE name = 'Legendary Pokémon'), 19, 1550, 194, 'A POKéMON that has been admired since the past for its beauty. It runs agilely as if on wings.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (60, 'Poliwag', (SELECT id FROM species WHERE name = 'Tadpole Pokémon'), 6, 124, 60, 'Its newly grown legs prevent it from running. It appears to prefer swimming than trying to stand.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (61, 'Poliwhirl', (SELECT id FROM species WHERE name = 'Tadpole Pokémon'), 10, 200, 135, 'Capable of living in or out of water. When out of water, it sweats to keep its body slimy.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (62, 'Poliwrath', (SELECT id FROM species WHERE name = 'Tadpole Pokémon'), 13, 540, 255, 'An adept swimmer at both the front crawl and breast stroke. Easily overtakes the best human swimmers.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (63, 'Abra', (SELECT id FROM species WHERE name = 'Psi Pokémon'), 9, 195, 62, 'Using its ability to read minds, it will identify impending danger and TELEPORT to safety.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (64, 'Kadabra', (SELECT id FROM species WHERE name = 'Psi Pokémon'), 13, 565, 140, 'It emits special alpha waves from its body that induce headaches just by being close by.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (65, 'Alakazam', (SELECT id FROM species WHERE name = 'Psi Pokémon'), 15, 480, 250, 'Its brain can out­ perform a super­ computer. Its intelligence quotient is said to be 5,000.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (66, 'Machop', (SELECT id FROM species WHERE name = 'Superpower Pokémon'), 8, 195, 61, 'Loves to build its muscles. It trains in all styles of martial arts to become even stronger.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (67, 'Machoke', (SELECT id FROM species WHERE name = 'Superpower Pokémon'), 15, 705, 142, 'Its muscular body is so powerful, it must wear a power save belt to be able to regulate its motions.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (68, 'Machamp', (SELECT id FROM species WHERE name = 'Superpower Pokémon'), 16, 1300, 253, 'Using its heavy muscles, it throws powerful punches that can send the victim clear over the horizon.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (69, 'Bellsprout', (SELECT id FROM species WHERE name = 'Flower Pokémon'), 7, 40, 60, 'A carnivorous POKéMON that traps and eats bugs. It uses its root feet to soak up needed moisture.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (70, 'Weepinbell', (SELECT id FROM species WHERE name = 'Flycatcher Pokémon'), 10, 64, 137, 'It spits out POISONPOWDER to immobilize the enemy and then finishes it with a spray of ACID.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (71, 'Victreebel', (SELECT id FROM species WHERE name = 'Flycatcher Pokémon'), 17, 155, 221, 'Said to live in huge colonies deep in jungles, although no one has ever returned from there.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (72, 'Tentacool', (SELECT id FROM species WHERE name = 'Jellyfish Pokémon'), 9, 455, 67, 'Drifts in shallow seas. Anglers who hook them by accident are often punished by its stinging acid.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (73, 'Tentacruel', (SELECT id FROM species WHERE name = 'Jellyfish Pokémon'), 16, 550, 180, 'The tentacles are normally kept short. On hunts, they are extended to ensnare and immobilize prey.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (74, 'Geodude', (SELECT id FROM species WHERE name = 'Rock Pokémon'), 4, 200, 60, 'Found in fields and mountains. Mistaking them for boulders, people often step or trip on them.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (75, 'Graveler', (SELECT id FROM species WHERE name = 'Rock Pokémon'), 10, 1050, 137, 'Rolls down slopes to move. It rolls over any obstacle without slowing or changing its direction.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (76, 'Golem', (SELECT id FROM species WHERE name = 'Megaton Pokémon'), 14, 3000, 223, 'Its boulder-like body is extremely hard. It can easily withstand dynamite blasts without damage.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (77, 'Ponyta', (SELECT id FROM species WHERE name = 'Fire Horse Pokémon'), 10, 300, 82, 'Its hooves are 10 times harder than diamonds. It can trample anything completely flat in little time.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (78, 'Rapidash', (SELECT id FROM species WHERE name = 'Fire Horse Pokémon'), 17, 950, 175, 'Very competitive, this POKéMON will chase anything that moves fast in the hopes of racing it.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (79, 'Slowpoke', (SELECT id FROM species WHERE name = 'Dopey Pokémon'), 12, 360, 63, 'Incredibly slow and dopey. It takes 5 seconds for it to feel pain when under attack.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (80, 'Slowbro', (SELECT id FROM species WHERE name = 'Hermit Crab Pokémon'), 16, 785, 172, 'The SHELLDER that is latched onto SLOWPOKE''s tail is said to feed on the host''s left over scraps.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (81, 'Magnemite', (SELECT id FROM species WHERE name = 'Magnet Pokémon'), 3, 60, 65, 'Uses anti-gravity to stay suspended. Appears without warning and uses THUNDER WAVE and similar moves.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (82, 'Magneton', (SELECT id FROM species WHERE name = 'Magnet Pokémon'), 10, 600, 163, 'Formed by several MAGNEMITEs linked together. They frequently appear when sunspots flare up.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (83, 'Farfetchd', (SELECT id FROM species WHERE name = 'Wild Duck Pokémon'), 8, 150, 132, 'The sprig of green onions it holds is its weapon. It is used much like a metal sword.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (84, 'Doduo', (SELECT id FROM species WHERE name = 'Twin Bird Pokémon'), 14, 392, 62, 'A bird that makes up for its poor flying with its fast foot speed. Leaves giant footprints.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (85, 'Dodrio', (SELECT id FROM species WHERE name = 'Triple Bird Pokémon'), 18, 852, 165, 'Uses its three brains to execute complex plans. While two heads sleep, one head stays awake.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (86, 'Seel', (SELECT id FROM species WHERE name = 'Sea Lion Pokémon'), 11, 900, 65, 'The protruding horn on its head is very hard. It is used for bashing through thick ice.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (87, 'Dewgong', (SELECT id FROM species WHERE name = 'Sea Lion Pokémon'), 17, 1200, 166, 'Stores thermal energy in its body. Swims at a steady 8 knots even in intensely cold waters.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (88, 'Grimer', (SELECT id FROM species WHERE name = 'Sludge Pokémon'), 9, 300, 65, 'Appears in filthy areas. Thrives by sucking up polluted sludge that is pumped out of factories.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (89, 'Muk', (SELECT id FROM species WHERE name = 'Sludge Pokémon'), 12, 300, 175, 'Thickly covered with a filthy, vile sludge. It is so toxic, even its footprints contain poison.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (90, 'Shellder', (SELECT id FROM species WHERE name = 'Bivalve Pokémon'), 3, 40, 61, 'Its hard shell repels any kind of attack. It is vulnerable only when its shell is open.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (91, 'Cloyster', (SELECT id FROM species WHERE name = 'Bivalve Pokémon'), 15, 1325, 184, 'When attacked, it launches its horns in quick volleys. Its innards have never been seen.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (92, 'Gastly', (SELECT id FROM species WHERE name = 'Gas Pokémon'), 13, 1, 62, 'Almost invisible, this gaseous POKéMON cloaks the target and puts it to sleep without notice.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (93, 'Haunter', (SELECT id FROM species WHERE name = 'Gas Pokémon'), 16, 1, 142, 'Because of its ability to slip through block walls, it is said to be from an­ other dimension.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (94, 'Gengar', (SELECT id FROM species WHERE name = 'Shadow Pokémon'), 15, 405, 250, 'Under a full moon, this POKéMON likes to mimic the shadows of people and laugh at their fright.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (95, 'Onix', (SELECT id FROM species WHERE name = 'Rock Snake Pokémon'), 88, 2100, 77, 'As it grows, the stone portions of its body harden to become similar to a diamond, but colored black.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (96, 'Drowzee', (SELECT id FROM species WHERE name = 'Hypnosis Pokémon'), 10, 324, 66, 'Puts enemies to sleep then eats their dreams. Occasionally gets sick from eating bad dreams.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (97, 'Hypno', (SELECT id FROM species WHERE name = 'Hypnosis Pokémon'), 16, 756, 169, 'When it locks eyes with an enemy, it will use a mix of PSI moves such as HYPNOSIS and CONFUSION.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (98, 'Krabby', (SELECT id FROM species WHERE name = 'River Crab Pokémon'), 4, 65, 65, 'Its pincers are not only powerful weapons, they are used for balance when walking sideways.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (99, 'Kingler', (SELECT id FROM species WHERE name = 'Pincer Pokémon'), 13, 600, 166, 'The large pincer has 10000 hp of crushing power. However, its huge size makes it unwieldy to use.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (100, 'Voltorb', (SELECT id FROM species WHERE name = 'Ball Pokémon'), 5, 104, 66, 'Usually found in power plants. Easily mistaken for a POKé BALL, they have zapped many people.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (101, 'Electrode', (SELECT id FROM species WHERE name = 'Ball Pokémon'), 12, 666, 172, 'It stores electric energy under very high pressure. It often explodes with little or no provocation.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (102, 'Exeggcute', (SELECT id FROM species WHERE name = 'Egg Pokémon'), 4, 25, 65, 'Often mistaken for eggs. When disturbed, they quickly gather and attack in swarms.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (103, 'Exeggutor', (SELECT id FROM species WHERE name = 'Coconut Pokémon'), 20, 1200, 186, 'Legend has it that on rare occasions, one of its heads will drop off and continue on as an EXEGGCUTE.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (104, 'Cubone', (SELECT id FROM species WHERE name = 'Lonely Pokémon'), 4, 65, 64, 'Because it never removes its skull helmet, no one has ever seen this POKéMON''s real face.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (105, 'Marowak', (SELECT id FROM species WHERE name = 'Bone Keeper Pokémon'), 10, 450, 149, 'The bone it holds is its key weapon. It throws the bone skillfully like a boomerang to KO targets.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (106, 'Hitmonlee', (SELECT id FROM species WHERE name = 'Kicking Pokémon'), 15, 498, 159, 'When in a hurry, its legs lengthen progressively. It runs smoothly with extra long, loping strides.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (107, 'Hitmonchan', (SELECT id FROM species WHERE name = 'Punching Pokémon'), 14, 502, 159, 'While apparently doing nothing, it fires punches in lightning fast volleys that are impossible to see.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (108, 'Lickitung', (SELECT id FROM species WHERE name = 'Licking Pokémon'), 12, 655, 77, 'Its tongue can be extended like a chameleon''s. It leaves a tingling sensation when it licks enemies.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (109, 'Koffing', (SELECT id FROM species WHERE name = 'Poison Gas Pokémon'), 6, 10, 68, 'Because it stores several kinds of toxic gases in its body, it is prone to exploding without warning.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (110, 'Weezing', (SELECT id FROM species WHERE name = 'Poison Gas Pokémon'), 12, 95, 172, 'Where two kinds of poison gases meet, 2 KOFFINGs can fuse into a WEEZING over many years.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (111, 'Rhyhorn', (SELECT id FROM species WHERE name = 'Spikes Pokémon'), 10, 1150, 69, 'A POKéMON with a one-track mind. Once it charges,  it won''t stop running until it falls asleep.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (112, 'Rhydon', (SELECT id FROM species WHERE name = 'Drill Pokémon'), 19, 1200, 170, 'Protected by an armor-like hide, it is capable of living in molten lava of 3,600 degrees.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (113, 'Chansey', (SELECT id FROM species WHERE name = 'Egg Pokémon'), 11, 346, 395, 'A rare and elusive POKéMON that is said to bring happiness to those who manage to get it.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (114, 'Tangela', (SELECT id FROM species WHERE name = 'Vine Pokémon'), 10, 350, 87, 'The whole body is swathed with wide vines that are similar to sea­ weed. Its vines shake as it walks.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (115, 'Kangaskhan', (SELECT id FROM species WHERE name = 'Parent Pokémon'), 22, 800, 172, 'The infant rarely ventures out of its mother''s protective pouch until it is 3 years old.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (116, 'Horsea', (SELECT id FROM species WHERE name = 'Dragon Pokémon'), 4, 80, 59, 'Known to shoot down flying bugs with precision blasts of ink from the surface of the water.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (117, 'Seadra', (SELECT id FROM species WHERE name = 'Dragon Pokémon'), 12, 250, 154, 'Capable of swim­ ming backwards by rapidly flapping its wing-like pectoral fins and stout tail.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (118, 'Goldeen', (SELECT id FROM species WHERE name = 'Goldfish Pokémon'), 6, 150, 64, 'Its tail fin billows like an elegant ballroom dress, giving it the nickname of the Water Queen.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (119, 'Seaking', (SELECT id FROM species WHERE name = 'Goldfish Pokémon'), 13, 390, 158, 'In the autumn spawning season, they can be seen swimming powerfully up rivers and creeks.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (120, 'Staryu', (SELECT id FROM species WHERE name = 'Star Shape Pokémon'), 8, 345, 68, 'If its body is torn, it can grow back if the red core remains. The core flashes at midnight.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (121, 'Starmie', (SELECT id FROM species WHERE name = 'Mysterious Pokémon'), 11, 800, 182, 'Its central core glows with the seven colors of the rainbow. Some people value the core as a gem.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (122, 'Mr Mime', (SELECT id FROM species WHERE name = 'Barrier Pokémon'), 13, 545, 161, 'If interrupted while it is miming, it will slap around the offender with its broad hands.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (123, 'Scyther', (SELECT id FROM species WHERE name = 'Mantis Pokémon'), 15, 560, 100, 'With ninja-like agility and speed, it can create the illusion that there is more than one.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (124, 'Jynx', (SELECT id FROM species WHERE name = 'Human Shape Pokémon'), 14, 406, 159, 'It seductively wiggles its hips as it walks. It can cause people to dance in unison with it.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (125, 'Electabuzz', (SELECT id FROM species WHERE name = 'Electric Pokémon'), 11, 300, 172, 'Normally found near power plants, they can wander away and cause major blackouts in cities.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (126, 'Magmar', (SELECT id FROM species WHERE name = 'Spitfire Pokémon'), 13, 445, 173, 'Its body always burns with an orange glow that enables it to hide perfectly among flames.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (127, 'Pinsir', (SELECT id FROM species WHERE name = 'Stag Beetle Pokémon'), 15, 550, 175, 'If it fails to crush the victim in its pincers, it will swing it around and toss it hard.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (128, 'Tauros', (SELECT id FROM species WHERE name = 'Wild Bull Pokémon'), 14, 884, 172, 'When it targets an enemy, it charges furiously while whipping its body with its long tails.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (129, 'Magikarp', (SELECT id FROM species WHERE name = 'Fish Pokémon'), 9, 100, 40, 'In the distant past, it was somewhat stronger than the horribly weak descendants that exist today.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (130, 'Gyarados', (SELECT id FROM species WHERE name = 'Atrocious Pokémon'), 65, 2350, 189, 'Once it begins to rampage, a GYARADOS will burn everything down, even in a harsh storm.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (131, 'Lapras', (SELECT id FROM species WHERE name = 'Transport Pokémon'), 25, 2200, 187, 'A POKéMON that has been over­ hunted almost to extinction. It can ferry people across the water.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (132, 'Ditto', (SELECT id FROM species WHERE name = 'Transform Pokémon'), 3, 40, 101, 'Capable of copying an enemy''s genetic code to instantly transform itself into a duplicate of the enemy.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (133, 'Eevee', (SELECT id FROM species WHERE name = 'Evolution Pokémon'), 3, 65, 65, 'Its genetic code is irregular. It may mutate if it is exposed to radiation from element STONEs.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (134, 'Vaporeon', (SELECT id FROM species WHERE name = 'Bubble Jet Pokémon'), 10, 290, 184, 'Lives close to water. Its long tail is ridged with a fin which is often mistaken for a mermaid''s.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (135, 'Jolteon', (SELECT id FROM species WHERE name = 'Lightning Pokémon'), 8, 245, 184, 'It accumulates negative ions in the atmosphere to blast out 10000- volt lightning bolts.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (136, 'Flareon', (SELECT id FROM species WHERE name = 'Flame Pokémon'), 9, 250, 184, 'When storing thermal energy in its body, its temperature could soar to over 1600 degrees.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (137, 'Porygon', (SELECT id FROM species WHERE name = 'Virtual Pokémon'), 8, 365, 79, 'A POKéMON that consists entirely of programming code. Capable of moving freely in cyberspace.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (138, 'Omanyte', (SELECT id FROM species WHERE name = 'Spiral Pokémon'), 4, 75, 71, 'Although long extinct, in rare cases, it can be genetically resurrected from fossils.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (139, 'Omastar', (SELECT id FROM species WHERE name = 'Spiral Pokémon'), 10, 350, 173, 'A prehistoric POKéMON that died out when its heavy shell made it impossible to catch prey.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (140, 'Kabuto', (SELECT id FROM species WHERE name = 'Shellfish Pokémon'), 5, 115, 71, 'A POKéMON that was resurrected from a fossil found in what was once the ocean floor eons ago.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (141, 'Kabutops', (SELECT id FROM species WHERE name = 'Shellfish Pokémon'), 13, 405, 173, 'Its sleek shape is perfect for swim­ ming. It slashes prey with its claws and drains the body fluids.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (142, 'Aerodactyl', (SELECT id FROM species WHERE name = 'Fossil Pokémon'), 18, 590, 180, 'A Pokémon that roamed the skies in the dinosaur era. Its teeth are like saw blades.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (143, 'Snorlax', (SELECT id FROM species WHERE name = 'Sleeping Pokémon'), 21, 4600, 189, 'Very lazy. Just eats and sleeps. As its rotund bulk builds, it becomes steadily more slothful.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (144, 'Articuno', (SELECT id FROM species WHERE name = 'Freeze Pokémon'), 17, 554, 290, 'A legendary bird POKéMON that is said to appear to doomed people who are lost in icy mountains.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (145, 'Zapdos', (SELECT id FROM species WHERE name = 'Electric Pokémon'), 16, 526, 290, 'A legendary bird POKéMON that is said to appear from clouds while dropping enormous lightning bolts.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (146, 'Moltres', (SELECT id FROM species WHERE name = 'Flame Pokémon'), 20, 600, 290, 'Known as the legendary bird of fire. Every flap of its wings creates a dazzling flash of flames.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (147, 'Dratini', (SELECT id FROM species WHERE name = 'Dragon Pokémon'), 18, 33, 60, 'Long considered a mythical POKéMON until recently when a small colony was found living underwater.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (148, 'Dragonair', (SELECT id FROM species WHERE name = 'Dragon Pokémon'), 40, 165, 147, 'A mystical POKéMON that exudes a gentle aura. Has the ability to change climate conditions.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (149, 'Dragonite', (SELECT id FROM species WHERE name = 'Dragon Pokémon'), 22, 2100, 300, 'An extremely rarely seen marine POKéMON. Its intelligence is said to match that of humans.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (150, 'Mewtwo', (SELECT id FROM species WHERE name = 'Genetic Pokémon'), 20, 1220, 340, 'It was created by a scientist after years of horrific gene splicing and DNA engineering experiments.');
INSERT INTO pokemon (id, name, species_id, height, weight, base_experience, description) VALUES (151, 'Mew', (SELECT id FROM species WHERE name = 'New Species Pokémon'), 4, 40, 300, 'So rare that it is still said to be a mirage by many experts. Only a few people have seen it worldwide.');
